CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `teachercourse` AS select `course`.`course_id` AS `course_id`,`course`.`course_name` AS `course_name`,`teacher`.`teacher_id` AS `teacher_id`,`teacher`.`real_name` AS `real_name`,`teacher`.`teacher_no` AS `teacher_no`,`courseclass_teacher`.`courseclass_id` AS `courseclass_id`,`courseclass`.`term` AS `term` from (((`course` join `courseclass` on((`course`.`course_id` = `courseclass`.`course_id`))) join `courseclass_teacher` on((`courseclass`.`courseclass_id` = `courseclass_teacher`.`courseclass_id`))) join `teacher` on((`courseclass_teacher`.`teacher_id` = `teacher`.`teacher_id`))) where (`courseclass`.`term` = '2022-2023-01') order by `teacher`.`teacher_id`;

